import React, { Component } from 'react';

class Select extends Component {

    constructor(props){
        super(props);
        this.state = {
                names: [
                {
                    id : 1,
                    client : "Ram"
                }, 
                {
                    id : 2,
                    client : "Jaya",
                }, 
                {
                    id : 3,
                    client : "Vinod",
                },
                {
                    id : 4,
                    client : "Vijay"
                },
            ]
        }
    }

    render() {
        return (
            <div>
                <select>
                {this.state.names.map((id, client) => (
                    <option key={id} name={id}>{client}</option>
                ))}
                </select>

            </div>
        );
    }
}

export default Select;
